// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div className="container-fluid text-center">
                    {/* My Profile Picture */}
                    <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                    {/* About Me Context */}
                    <div id="AboutMeContext">
                        <p className="text-white lead">
                            Thank you for stopping by, and welcome to my official website. My name is Shawn Luther, and I am a
                            web developer with a passion for creation. I was born and rasied in Delaware County Pennsylvania. Since I was a little kid I have always taken interest
                            at the complexities of the world around me, especially when it came to software. I created my
                            first program in Batch at the age of twelve, and have been coding ever since. Since then, I
                            have moved on to learning other languages, fameworks, and libraries which have allowed me
                            to create dynamic applications and have helped me do, create, and accomplish things I
                            never thought I would ever be able to do. This website is a place for me to showcase
                             the projects I have worked on and created over the years, showing you a filtered
                             sneak peak of my proudest work as a developer. When I'm not working I'm usually
                             either playing video games, hanging with friends, or on a good day, going out
                             to eat, which is one of  my favorite things to do! My all time favorite food
                             is baby back ribs, which is superior to steak, and you can't
                             tell me otherwise.
                        </p>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
